import React from "react";
import { NavLink } from "react-router-dom";
import "./menu.css";

function Menu() {
  return (
    <>
      <div className="navlink">
        <NavLink to="/" className="navSpace">
          Home
        </NavLink>
        <NavLink to="/About" className="navSpace">
          About Us
        </NavLink>
        <NavLink to="/Items" className="navSpace">
          Items
        </NavLink>
        <NavLink to="Booking" className="navSpace">
          Booking
        </NavLink>
      </div>
    </>
  );
}

export default Menu;
